import React from "react";
import "../styles/login.css";
import { Link } from "react-router-dom";

function Login() {
    return (
        <div className="login">
            <h1 className="login-title">Login</h1>
            <form className="form">
                <label className="login_label">Username:</label>
                <input className="login_input" placeholder="Username"></input>
                <span className="error">
                    Username is incorrect (only letters)
                </span>
                <label className="login_label">Password:</label>
                <input className="login_input" placeholder="Password"></input>
                <span className="error">
                    Password is incorrect (must be 5 and more symbols)
                </span>
                <div className="btn-container">
                    <button className="btn">
                        <Link to="/home">Go!</Link>
                    </button>
                </div>
            </form>
        </div>
    );
}

export default Login;
